import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { bookingAPI, getImageURL } from '../../services/api';
import './MyBookings.css';

function MyBookings() {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    loadBookings();
  }, []);

  const loadBookings = async () => {
    try {
      console.log('üìÇ Loading bookings from backend...');
      setLoading(true);
      
      const response = await bookingAPI.getUserBookings();
      console.log('üì¶ Full backend response:', response);
      console.log('üì¶ Response data:', response.data);
      
      // ‚úÖ FLEXIBLE: Handle multiple response formats
      // Format 1: { data: { bookings: [...] } }
      // Format 2: { data: [...] }
      // Format 3: { bookings: [...] }
      const bookingsData = 
        response.data.bookings ||  // Format from my updated controller
        response.data.data ||       // Your current format
        response.data ||            // Direct array
        [];
      
      console.log('‚úÖ Bookings extracted:', bookingsData);
      console.log('üìä Number of bookings:', bookingsData.length);
      
      setBookings(bookingsData);
      setError('');
      setLoading(false);
    } catch (err) {
      console.error('‚ùå Error loading bookings:', err);
      console.error('‚ùå Error response:', err.response);
      
      // Better error message based on error type
      let errorMessage = 'Failed to load bookings.';
      
      if (err.response?.status === 401) {
        errorMessage = 'Please login to view your bookings.';
        setTimeout(() => navigate('/login'), 2000);
      } else if (err.response?.status === 500) {
        errorMessage = 'Server error. Please check if the backend is running.';
      } else if (err.message === 'Network Error') {
        errorMessage = 'Cannot connect to server. Please check if backend is running.';
      }
      
      setError(errorMessage);
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    try {
      return new Date(dateString).toLocaleDateString('en-US', {
        year: 'numeric',
        month: 'long',
        day: 'numeric'
      });
    } catch (e) {
      return dateString;
    }
  };

  const formatTime = (timeString) => {
    if (!timeString) return 'N/A';
    // Handle both HH:MM:SS and HH:MM formats
    return timeString.split(':').slice(0, 2).join(':');
  };

  const getStatusColor = (status) => {
    switch(status?.toLowerCase()) {
      case 'confirmed':
        return '#27ae60';
      case 'completed':
        return '#3498db';
      case 'cancelled':
        return '#e74c3c';
      default:
        return '#f39c12'; // pending
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading bookings...</p>
      </div>
    );
  }

  return (
    <div className="my-bookings-container">
      <div className="bookings-header">
        <div>
          <h1>My Bookings</h1>
          <p>View your booking history</p>
        </div>
        <button className="back-btn" onClick={() => navigate('/')}>
          ‚Üê Back to Home
        </button>
      </div>

      {error && (
        <div className="error-message">
          <span className="error-icon">‚ö†Ô∏è</span>
          <span>{error}</span>
        </div>
      )}

      {bookings.length === 0 && !error ? (
        <div className="no-bookings">
          <div className="no-bookings-icon">üìÖ</div>
          <h2>You haven't made any bookings yet</h2>
          <p>Start exploring our collection and book your favorite artwork!</p>
          <button className="browse-btn" onClick={() => navigate('/')}>
            Browse Artworks
          </button>
        </div>
      ) : (
        <div className="bookings-grid">
          {bookings.map((booking, index) => (
            <div key={booking.booking_id || index} className="booking-card">
              <div className="booking-card-header">
                <span className="booking-id">Booking #{booking.booking_id || index + 1}</span>
                <span 
                  className="booking-status"
                  style={{ backgroundColor: getStatusColor(booking.status || 'pending') }}
                >
                  {(booking.status || 'PENDING').toUpperCase()}
                </span>
              </div>

              <div className="booking-artwork">
                <img 
                  src={getImageURL(booking.image_url)} 
                  alt={booking.artwork_title}
                  onError={(e) => {
                    e.target.src = 'https://via.placeholder.com/150x180?text=No+Image';
                  }}
                />
                <div className="booking-artwork-info">
                  <h3>{booking.artwork_title || 'Untitled Artwork'}</h3>
                  <p className="booking-artist">By {booking.artist_name || 'Unknown Artist'}</p>
                  <p className="booking-price">
                    NPR {Number(booking.total_amount || booking.artwork_price || 0).toLocaleString()}
                  </p>
                </div>
              </div>

              <div className="booking-divider"></div>

              <div className="booking-details">
                <div className="detail-item">
                  <span className="detail-icon">üìÖ</span>
                  <div>
                    <span className="detail-label">Date</span>
                    <span className="detail-value">
                      {formatDate(booking.preferred_date)}
                    </span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üïê</span>
                  <div>
                    <span className="detail-label">Time</span>
                    <span className="detail-value">{formatTime(booking.preferred_time)}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üë§</span>
                  <div>
                    <span className="detail-label">Name</span>
                    <span className="detail-value">{booking.customer_name}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üìß</span>
                  <div>
                    <span className="detail-label">Email</span>
                    <span className="detail-value">{booking.email}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üì±</span>
                  <div>
                    <span className="detail-label">Phone</span>
                    <span className="detail-value">{booking.phone}</span>
                  </div>
                </div>

                {booking.delivery_address && (
                  <div className="detail-item">
                    <span className="detail-icon">üìç</span>
                    <div>
                      <span className="detail-label">Address</span>
                      <span className="detail-value">{booking.delivery_address}</span>
                    </div>
                  </div>
                )}
              </div>

              {booking.special_instructions && (
                <>
                  <div className="booking-divider"></div>
                  <div className="booking-notes">
                    <h4>Additional Notes</h4>
                    <p>{booking.special_instructions}</p>
                  </div>
                </>
              )}

              <div className="booking-footer">
                <span className="booking-date">
                  Booked on: {formatDate(booking.created_at)}
                </span>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default MyBookings;
